'use strict';

var updateHash = function updateHash(location) {
  if (window.history && window.history.replaceState) {
    if (window.location.hash === location) return;

    history.replaceState({}, document.title, location);
  }
};

var updateActive = function updateActive(hash) {
  var element = document.querySelector('a[href="' + hash + '"]');

  if (!element || element.classList.contains('active')) return;

  Array.from(document.querySelectorAll('#menu ul li.active')).forEach(function (current) {
    current.classList.remove('active');
    current.parentNode.classList.remove('active');
  });

  while (true) {
    var parentNode = element.parentNode;
    if (!parentNode) {
      break;
    }

    var nodeName = parentNode.nodeName.toLowerCase();
    if (nodeName === 'nav') {
      break;
    }

    if (nodeName === 'li') {
      parentNode.classList.add('active');
    }

    element = parentNode.parentNode;
  }
};

document.addEventListener('DOMContentLoaded', function (event) {
  var header = document.querySelector('#header > .b-nav');
  var body = document.body;

  var handleHeader = function handleHeader(scrollPosition) {
    if (scrollPosition === 0) {
      if (!body.classList.contains('header--fixed')) {
        body.classList.add('header--fixed');
      }
    } else {
      if (body.classList.contains('header--fixed')) {
        body.classList.remove('header--fixed');
      }
    }
  };

  var handleScroll = function handleScroll(event) {
    handleHeader(document.documentElement.scrollTop);

    var scrollPosition = document.documentElement.scrollTop;
    var elements = document.querySelectorAll('#menu ul li a');
    var mapping = Array.from(elements).map(function (elem) {
      var section = document.querySelector(elem.getAttribute('href'));
      return {
        position: section.offsetTop - 5,
        element: elem,
        container: section
      };
    });

    mapping.forEach(function (section, index) {
      if (section.position < scrollPosition && mapping[index + 1] && mapping[index + 1].position > scrollPosition && window.location.hash !== section.element.getAttribute('href')) {
        var keepScroll = scrollPosition;
        updateHash(section.element.getAttribute('href'));
        updateActive(window.location.hash);
      }
    });
  };

  document.addEventListener('scroll', handleScroll);
  window.addEventListener('hashchange', function (e) {
    e.preventDefault();
    updateActive(window.location.hash);
  }, false);

  handleHeader(document.documentElement.scrollTop);
  updateActive(window.location.hash);
});

